import React from 'react'



class MonthDropDown extends React.Component {

  state = {

    MonthSelected: [],

  }




  render () {

    return (



        <select name="category">
        <option selected value="jan">Jan</option>
        <option value="feb">Feb</option>
        <option value="mar">Food</option>
        <option value="apr">Travel</option>
        <option value="may">Phone</option>
        <option value="jun">Holiday</option>
        <option value="jul">Retail</option>
        <option value="aug">Tech</option>
        <option value="sep">Other</option>
        <option value="oct">Other</option>
        <option value="nov">Other</option>
        <option value="dev">Other</option>
       </select>


    )
  }
}



export default MonthDropDown
